import React from "react";
import "./App.css";
import Navbar from "./Components/Navbar";
import ExpensesItem from "./Components/Expenses/ExpensesItem";
import ExpensesFrom from "./Components/AddExpenses/ExpensesForm";
import Expenses from "./Components/Expenses/Expenses";
const App = () => {
  const expense = [
    {
      title: "Car Insurance",
      amount: "9456",
      date: new Date(2021, 4, 12),
    },
    {
      title: "Car Insurance",
      amount: "9456",
      date: new Date(2021, 4, 12),
    },
    {
      title: "Csr Insurance",
      amount: "9456",
      date: new Date(2021, 4, 12),
    },
    {
      title: "Car Insurance",
      amount: "9456",
      date: new Date(2021, 4, 12),
    },
  ];
  const addExpenseHandler = (expense) => {
    console.log("In App");
    console.log(expense);
  };
  return (
    <div>
      <Navbar />
      <ExpensesFrom onAddExpenses={addExpenseHandler} />
      <Expenses item={expense} />
    </div>
  );
};
export default App;
